import React from "react";
import Input from "../../../../ui/Input";
import Label from "../../../../ui/Label";
import TextArea from "../../../../ui/TextArea";

export default function FormElement({
  formElType,
  labelText,
  inputName,
  inputType,
  inputRequired
}) {
  let element = "";
  console.log(formElType);
  if ((formElType = "input")) {
    element = (
      <Input
        type={inputType}
        id={inputName}
        name={inputName}
        required={inputRequired}
      />
    );
  } else if ((formElType = "textArea")) {
    element = <TextArea id="comment" cols="5" name="comment" />;
  }

  return (
    <div className="FormElement">
      <Label htmlFor={inputName} text={labelText} />
      <span>{element}</span>
    </div>
  );
}
